import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome, faUser } from '@fortawesome/free-solid-svg-icons';
import './Workerpage.css';

const WorkerPage = () => {
  const [showProductivity, setShowProductivity] = useState(false);

  const toggleProductivity = () => {
    setShowProductivity(!showProductivity);
  };

  return (
    <div className="worker-page-container">
      <img src="logo2.png" alt="Logo" className="logo" />
      <div className="dashboard-text" onClick={toggleProductivity}>
        Employee Productivity Dashboard
      </div>
      {showProductivity && (
        <div className="productivity-data">
          <p>productivity on Monday: 80%</p>
          <p>productivity on Tuesday: 75%</p>
          <p>productivity on Wednesday: 85%</p>
          <p>productivity on Thursday: 90%</p>
          <p>productivity on Friday: 85%</p>
          <p>productivity on Saturday: 70%</p>
        </div>
      )}
      <img src="logo3.png" alt="Worker Logo" className="worker-logo" />
      <div className="button-container">
        <button><FontAwesomeIcon icon={faHome} className="green-icon" /></button>
        <button className="button" disabled><FontAwesomeIcon icon={faUser} className="green-icon" /> </button>
      </div>
    </div>
  );
}

export default WorkerPage;
